import React from "react";
import "./card.css";
const Card = () => {
  return (
    <div className="_bg-light green dib br3 ma2 grow bw2 shadow-5">
      <img alt="robots" src="https://robohash.org/test?200*200" />
      <div>
        <h2>Jane Doe</h2>
        <p>JaneDoe@gmail.com</p>
      </div>
    </div>
  );
};
export default Card;
